class Solution:
    def strStr(self, haystack: str, needle: str) -> int:
        n1=len(haystack)
        target = len(needle)
        if target==0:
            return 0
        if n1<target:
            return -1
        for k in range(n1):
            j=0
            i=0
            while(k+i<=n1-1 and j<=target-1 and haystack[k+i]==needle[j] ): #这一步的复杂度较高
                i=i+1
                j=j+1
            if j==target:
                return k
        return -1

haystack = "3434abc1abcabc434'                    #"
needle = "abc                              aaaaaaa#"
x=Solution().strStr(haystack,needle)
print(x)
